import React, { Component } from 'react';

import { Link } from 'react-router-dom';


class Menu extends Component {
    render() {
        return (
            <div class="container">
                <div class="card">
                    <div class="card-body">
                        <div style={{position: 'absolute' , width: '100%', height: '100%'}}>
                            <object
                                data={require('../Docs/menu.pdf')}
                                type="application/pdf"
                                width="100%"
                                height= "100%"
                                >
                            </object>
                        
                       </div>
                     </div>
                </div>
            </div>

        )
    }
}
export default Menu;

